import './NavBar.css'

const NavBar = ({color, textColor, fontSize}) => {
    return (
        <header className='NavBar' style={{backgroundColor:color, color:textColor, fontSize: fontSize}}>
            <a href='/'>HOME</a>
        </header>
    )
};

export default NavBar;
